--This is a single database of books for teaching purposes
--It is based on https://corgis-edu.github.io/corgis/csv/classics/
--brendanpshea@gmail.com


DROP TABLE IF EXISTS "books"
CREATE TABLE IF NOT EXISTS "books" (
	"id"	INTEGER,
	"title"	TEXT NOT NULL,
	"author_name"	VARCHAR(100) NOT NULL,
	"pub_year"	INTEGER,
	"subjects"	TEXT,
	"lcc"	CHAR,
	"url"	VARCHAR(100),
	"words"	INT,
	"sentences"	SMALLINT,
	"characters"	BIGINT,
	"grade_level"	REAL,
	"popularity"	INTEGER,
	PRIMARY KEY("id")
);
